def avto_info(kompaniya, model, rangi, korobka, yili, narhi=None):    """Avtomobil haqidagi ma'lumotlarni lug'at ko'rinishida     qaytaruvchi funksiya"""    avto = {        "kompaniya": kompaniya,        "model": model,        "rangi": rangi,        "korobka": korobka,        "yil": yili,        "narhi": narhi,    }    return avtodef avto_kirit():    """Foydalanuvchiga avto_info funksiyasi yordamida bir     nechta avtolar haqida ma'lumotlarni bitta ro'yxatga     joylash imkonini beruvchi funksiya"""    avtolar = []    while True:        print("\nQuyidagi ma'lumotlarni kiriting", end="\n")        kompaniya = input("Ishlab chiqaruvchi: ")        model = input("Modeli: ")        rangi = input("Rangi: ")        korobka = input("Korobka: ")        yili = input("Ishlab chiqarilgan yili: ")        narhi = input("Narhi: ")        avtolar.append(avto_info(kompaniya, model, rangi, korobka, yili, narhi))        javob = input("Yana avto qo'shasizmi? (ha/yuq): ")        if javob == "yuq":            break    return avtolardef info_print(avto_info):    """Avtomobillar haqida ma'lumotlar saqlangan lug'atni     konsolga chiqaruvchi funksiya"""    print(f"{avto_info['rangi'].title()} \{avto_info['kompaniya'].upper()} {avto_info['model'].upper()}, \{avto_info['korobka']} korobka, {avto_info['yil']}-yil, \{avto_info['narhi']}$")    